import React, { Component }  from 'react'
import { createContract } from './../ethereum/DiplomaStorageContract'
import { Table, Button, Header, Container, Image, Form } from 'react-bootstrap';
import { web3 } from './../ethereum/web3';
import NavBar from './../assets/NavBar';




export class RenderStudents extends Component {

    state = {
        students: {
            name:'N/A',
            idStudent: 0,
            INE: 0,
            fisrtName: 'N/A',
            lastName: 'N/A',
            birth: 0,
        }

    }

  async componentDidMount () {
    await this.getStudents(this.getDiplomaStorageAddress()
    )
  }
  
  getDiplomaStorageAddress () {
    return this.props.match.params.address
  }

  async getStudents(address) {
    const contract = createContract(address)
    const accounts = await web3.eth.getAccounts()
    this.setState({ account: accounts[0] })
    console.log(accounts)
    
    this.setState({ contract })
    console.log(contract)

    const studentCount = await contract.methods.studentCount().call()
    this.setState({studentCount})

    for (var i = 1; i <= studentCount; i++) {
        const student = await contract.methods.students(i).call()
        this.setState({
          students: [...this.state.students, student]
        })
      }
    
}

constructor(props) {
    super(props)
    this.state = {
      account:'',
      studentCount: 0,
      students: [],
    }
}



  render() {
    return (
      <div>
          <header>
              <NavBar/>
          </header>
          <p>
          <Table className = "student-table" >
              <Table.Header>
                  <Table.Row>
                      <Table.HeaderCell>Student nÂ°</Table.HeaderCell>
                      <Table.HeaderCell>INE</Table.HeaderCell>
                      <Table.HeaderCell>First Name</Table.HeaderCell>
                      <Table.HeaderCell>Last Name</Table.HeaderCell>
                      <Table.HeaderCell>Birthday</Table.HeaderCell>
                  </Table.Row>
              </Table.Header>

              <Table.Body>

                  <Table.Row>
                  <Table.Cell>
            
              <ul id="taskList" className="list-unstyled">
                { this.state.students.map((student, key) => {
                     return(
                        <div className="taskTemplate"  key={key}>
            
                        {student.id}
        
                        </div>
                         )
                 })}
            </ul>
                 
            </Table.Cell>
            
            <Table.Cell sigleline="true">

            <ul id="taskList" className="list-unstyled">
                { this.state.students.map((student, key) => {
                    return(
                         <div className="taskTemplate"  key={key}>

                        {student.INE}
                        
                        </div>
                        )
                    })}
                </ul>

                </Table.Cell>
                 
                <Table.Cell>

                <ul id="taskList" className="list-unstyled">
                    { this.state.students.map((student, key) => {
                         return(
                          <div className="taskTemplate"  key={key}>
             
                            {student.firstName}
        
                            </div>
                        )
                    })}
                </ul>

                </Table.Cell>
                  
                 <Table.Cell sigleline="true">

                <ul id="taskList" className="list-unstyled">
                    { this.state.students.map((student, key) => {
                        return(
                         <div className="taskTemplate"  key={key}>
                
                        {student.lastName}

                        </div>
                        )
                     })}
                </ul>

                </Table.Cell>
                  
                <Table.Cell sigleline="true">

                <ul id="taskList" className="list-unstyled">
                    { this.state.students.map((student, key) => {
                        return(
                        <div className="taskTemplate"  key={key}>
                
                        {student.birth}
               
                        </div>
                        )
                    })}
                </ul>

                </Table.Cell>
                </Table.Row>


              </Table.Body>
          </Table>

          </p>
            
            

            <p>   
          <Button content ="Back"
            className="btn btn-lg btn-default"
            type="submit"
            onClick={this.onSubmitBack}
            >
             </Button>

             <Button content = "Refresh"
             className="btn btn-lg btn-default"
            type="submit"
            onClick={this.onSubmitReload}
            >
             </Button>
             </p> 

            

          
        
      
     </div>
    );
  }
}

export default RenderStudents;
